import React from 'react';
import styled from 'styled-components';
import palette from '../lib/styles/palette';

const MainItemBlock = styled.div`
  display: flex;
  padding-top: 1rem;
  padding-bottom: 1rem;
  border-top: 1px solid ${palette.gray[2]};
  .h1 {
    font-size: 100px;
    color: black;
  }
`;

const MainItem = ({ item }) => {
  const {
    stateDt,
    decideCnt,
    deathCnt,
    examCnt,
    clearCnt,
    resutlNegCnt,
    careCnt,
    accExamCnt,
  } = item;

  return (
    <MainItemBlock>
      <p>날짜: {stateDt}</p>,<p>{decideCnt}</p>, <p>{deathCnt}</p>,{' '}
      <p>{examCnt}</p>, <p>{clearCnt}</p>,<p>{resutlNegCnt}</p>,<p>{careCnt}</p>
      , <p>{accExamCnt}</p>
    </MainItemBlock>
  );
};

export default MainItem;
